- Support of HTTPS-connection everywhere, in the Internet or Onion network;
- In-built ad blocker
- Protection of your private information
- Detailed configuration of security and privacy settings for each site, including cookie policy, user-agent and javascript execution policy on viewed pages

Nothing in excess. Only the browser itself and technology which works for the benefit of your web security!

Download our app and get to the new level of freedom and security on the Internet with TOR Browser

